INSERT INTO `InquireBoard` VALUES (24,'1','메뉴 주문은 어떻게 해야해요?','메인 화면에 있는 ORDER에서 메뉴 주문을 할 수 있습니다.','2021-07-21 15:18:42','2021-04-12 11:54:53','Y','halo관리자'),(25,'1','원두는 주로 언제 들어오나요?','원두는 매주 토요일에 입고 됩니다.','2021-07-21 15:19:49','2021-04-12 13:55:10','Y','Halo관리자'),(26,'1','gps에서 제 위치를 못잡아요','앱을 삭제 후 다시 설치하거나 앱 업데이트를 해주세요.','2021-06-17 10:08:04','2021-06-15 16:57:53','N','Halo관리자'),(27,'1','전자영수증의 조회기간은 어떻게 되나요?','최대 12개월까지 가능합니다.','2021-06-17 10:08:45','2021-06-15 17:37:42','Y','Halo관리자'),(28,'1','여러 종류의 음료를 한 번에 주문할 수 있나요?','주문하기전 [메뉴 추가하기] 를 통해 여러 음료를 한번에 주문할 수 있습니다.','2021-06-17 10:12:35','2021-06-15 17:45:07','Y','Halo관리자'),(29,'1','한번에 주문 가능한 메뉴 수량은 어떻게 되나요?','1회 최대 20잔까지 주문할 수 있습니다. 20개 이상 주문을 원할 시에는 첫번째 주문한 메뉴를 수령한 이후 추가 주문이 가능합니다',NULL,'2021-06-17 10:13:21','Y','Halo관리자'),(30,'1','스마트오더의 결제수단은 어떻게 되나요?','신용카드, 삼성페이, 핸드폰 소액결제, 네이버페이, 카카오페이 등 가능합니다.',NULL,'2021-06-17 10:14:00','Y','Halo관리자'),(31,'1','스마트오더 주문접수가 되지 않고 있습니다. 어떻게 해야하나요?','매장에서 불가피하게 스마트오더 접수를 받지 못하거나 대기 순번이 많을 경우, 고객 본인이 선택하여 주문접수를 기다리거나 주문취소를 할 수 있습니다. 주문취소 없이 계속 대기해도 주문접수가 되지 않을 경우 약 7분후 주문이 자동취소되고 결제도 자동취소 처리 됩니다.',NULL,'2021-06-17 10:15:26','Y','Halo관리자'),(32,'1','스마트오더 주문내역을 어디서 볼 수 있나요?','우측 상단의 알람표시에서 볼 수 있습니다.',NULL,'2021-06-17 10:15:49','Y','Halo관리자'),(33,'1','스마트오더 주문 취소 시 리워드는 어떻게 되나요?','주문 취소 시 즉시 취소됩니다.',NULL,'2021-06-17 10:16:15','Y','Halo관리자'),(34,'1','선불카드란?','지정된 금액만큼 매장에서 현금처럼 사용할 수 있는 쿠폰입니다.',NULL,'2021-06-17 10:16:36','Y','Halo관리자'),(35,'1','선불카드는 어떻게 구매(선물)할 수 있나요?','해당 앱의 선불카드 카테고리에서 구매(선물)할 수 있습니다.',NULL,'2021-06-17 10:17:08','Y','Halo관리자'),(36,'1','선불카드는 어떻게 구매(선물)할 수 있나요?','해당 앱의 선불카드 카테고리에서 구매(선물)할 수 있습니다.',NULL,'2021-06-17 10:17:09','Y','Halo관리자'),(37,'1','구매(선물)한 금액권은 어떻게 확인하죠?','선물받는 고객이 해당 앱의 회원이고 App이 설치되어 있을 경우, App내의  선불카드에 생성됩니다. 설치되지 않았을 경우 문자메시지로 전달되며 추후 앱을 설치,및 회원가입을 하여 선불카드-선불카드내역에서 등록하여 사용 할 수 있습니다.',NULL,'2021-06-17 10:18:23','Y','Halo관리자'),(38,'2','질문 받아요','사절','2021-06-24 13:48:25','2021-06-24 13:47:56','N','질문 사절'),(39,'2','질문 받아요','사절',NULL,'2021-06-24 13:48:02','Y','질문 사절');
/*!40000 ALTER TABLE `InquireBoard` ENABLE KEYS */;
