INSERT INTO `SuggestBoard` VALUES (24,'1',NULL,'쿠폰 이용 안내','Halo 전 매장에서 쿠폰 사용이 가능 합니다. (일부 제외매장은 공지사항을 확인해 주세요) - 커피와 음료 구매시 1잔당 1개의 리워드가 적립되고 6개월간 유효합니다.(베이커리,굿즈 제외)  - 적립된 리워드는 리워드내역에서 확인할 수 있습니다. - 만약 리워드 적립을 못하셨다면 48시간 이내에 해당 매장에 방문하시면 영수증 확인 후 적립해드립니다. ',NULL,'Y','Halo 관리자','2021-04-12 11:54:53',NULL,'2021-06-15 16:39:29'),(25,'1',NULL,'리워드/프리퀀시 이용안내','리워드는 매장의 행사에 따라 증정용 음료 및 굿즈로 교환이 가능합니다. 리워드의 이용 제한 시간은 따로 없으며 사용 기한도 없습니다. ',NULL,'Y','임꺽정훈','2021-04-12 13:55:10',NULL,'2021-05-27 13:13:56'),(26,'1',NULL,'스마트오더 이용안내','\n\n- 매장 방문전에 모바일로 원하는 메뉴를 미리 주문/결제할 수 있어요.\n- 제조 완료 알림에 맞추어 매장에 도착하시면 주문 메뉴를 바로 픽업할 수 있어요.',NULL,'Y','Halo 관리자','2021-06-15 16:48:32',NULL,'2021-06-17 10:06:07'),(27,'1',NULL,'선불카드 이용 안내','- Halo 선물함에서 선불카드를 선물할 수 있어요.\n- 휴대폰에서 선물하실 분의 연락처를 선택하여 자유롭게 선물하기가 가능해요.\n- 오늘도 수고한 나에게 선물해 보세요:)',NULL,'Y','Halo 관리자','2021-06-15 16:49:26',NULL,'2021-06-17 10:07:05'),(33,'2',NULL,'고객은 왕이다!','!!!',NULL,'Y','고객왕','2021-06-24 13:47:37',NULL,NULL),(37,'1','105468185803851325812','아메리카노 원두 따로 파시나요?','궁금합니다','아메리카노 원두는 아직 따로 판매하지는 않습니다만\\n조만간 별도 판매를 위한 준비중에 있습니다.','N','imianman','2021-07-22 07:06:27','Halo 관리자','2021-07-23 13:02:54'),(38,'1','105468185803851325812','굿즈 한정판 언제 나오나요?','궁금',NULL,'Y','imianman','2021-07-22 07:10:22',NULL,NULL),(39,'1','105468185803851325812','굿즈 사고싶어요','싶엉 ㅜㅜ',NULL,'Y','imianman','2021-07-22 16:35:28',NULL,NULL),(40,'1','105468185803851325812','오픈시간 언제죠','?','오전 9시부터 오픈합니다.','Y','imianman','2021-07-22 17:01:27','Halo 관리자','2021-07-23 13:02:44'),(42,'1','105468185803851325812','닫는 시간이?','?','저녁 10시까지 운영하고 있습니다.','Y','imianman','2021-07-22 17:21:48','Halo 관리자','2021-07-23 12:39:15'),(43,'1','105468185803851325812','사장님 누구','누구신지','000님이 사장님이십니다.','Y','imianman','2021-07-22 17:30:19','Halo 관리자','2021-07-22 17:30:19');
